import React from "react";
import "./Item.css";
import { Button } from "@mui/material";

const Item = (props) => {
  return (
    <div className="container">
      <div className="item-div">
        <h3 className="item-h3">Hello</h3>
        <Button className="btn btn-success" variant="contained" color="success">
          Done
        </Button>
        <Button className="btn btn-error" variant="outlined" color="error">
          Delete
        </Button>
      </div>
    </div>
  );
};

export default Item;
